const styles = (theme) => ({
  historyItem: {
    marginBottom: theme.spacing(2),
  },
  noteStatus: {
    fontWeight: theme.typography.fontWeightBold,
  },
  teamCaseList: {
    paddingTop: theme.spacing(1),
    minWidth: '200px',
  },
});

export default styles;
